int square_size;
int brush_wid;


void grid_vert(SDL_Renderer *rend, int x , int y);
void grid_horz(SDL_Renderer *rend, int x , int y);

void grid_vert(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }
    for(i=0; i < brush_wid ; i++){
	    
      // vertical lines
      SDL_RenderDrawLine(rend, x+ half + i - half_brush  , y ,
			 x+ half + i - half_brush , y+sq );

      /* // horzontal lines
      SDL_RenderDrawLine(rend, 50  , 100 + (32/2) + i - (brush_wid/2) , 50+32 , 100+(32/2) + i - (brush_wid/2) );	    
      */    
    }
  }
}

void grid_horz(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }
    for(i=0; i < brush_wid ; i++){
	    
      // horzontal lines
      SDL_RenderDrawLine(rend, x  , y + half + i - half_brush ,
			 x+sq , y+ half + i - half_brush );	    
	    
    }
  }
}


void grid_north_east(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }
    for(i=0; i < brush_wid ; i++){

      // north
      SDL_RenderDrawLine(rend, x+ half + i - half_brush  , y ,
			 x+ half + i - half_brush , y+16 );      
      // east
      SDL_RenderDrawLine(rend, x+half  , y + half + i - half_brush ,
			 x+sq , y+ half + i - half_brush );	    	    
    }
  }
}

void grid_north_west(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }
    for(i=0; i < brush_wid ; i++){

      // north
      SDL_RenderDrawLine(rend, x+ half + i - half_brush  , y ,
			 x+ half + i - half_brush , y+half );      
      // west
      SDL_RenderDrawLine(rend, x  , y + half + i - half_brush ,
			 x+16 , y+ half + i - half_brush );
      
    }
  }
}


void grid_south_west(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }
    for(i=0; i < brush_wid ; i++){

      // south
      SDL_RenderDrawLine(rend, x+ half + i - half_brush  , y+ half ,
			 x+ half + i - half_brush , y+sq );      
      // west
      SDL_RenderDrawLine(rend, x  , y + half + i - half_brush ,
			 x+ half , y+ half + i - half_brush );
      
    }
  }
}


void grid_south_east(SDL_Renderer *rend, int x , int y){
  SDL_SetRenderDrawColor(rend, 255,0,0,0); // red
  {
    int i;
    int sq = square_size;
    int full = sq;
    int half = sq/2;
    int half_brush = brush_wid / 2;
    if (half_brush < 1){
      half_brush = 1;
    }

    for(i=0; i < brush_wid ; i++){
      
      // south
      SDL_RenderDrawLine(rend, x+ half + i - half_brush  , y+half ,
			 x+ half + i - half_brush , y+full );      
      // east
      SDL_RenderDrawLine(rend, x+ half , y + half + i - half_brush ,
			 x+full , y+half + i - half_brush);
      
    }
  }
}






